import Card from './Card';
import React from 'react';

export default function Cards({ courses }) {
  // Getting all data, i.e., objects in one array
  // We have an object of arrays where each array consists of objects
  let allCourses = [];

  // Returns an array of objects
  const getCourses = () => {
    // Making an array of arrays
    courses.forEach((courseCategory) => {
      courseCategory.forEach((course) => {
        allCourses.push(course);
      });
    });
    return allCourses;
  };

  return (
    <div>
      {getCourses().map((course, index) => (
        <Card key={index} course={course} />
      ))}
    </div>
  );
}
